import { ACTION_TYPES } from "../actions/customer";

const initialState = {
    list: []
}

export const customer = (state = initialState, action) => {
    switch (action.type) {
        case ACTION_TYPES.FETCH_ALL:
            return {
                ...state,
                list: [...action.payload]
            }

        default:
            return state
    }
}
